const express = require('express');
const mongoose = require('mongoose');
const shortUrlRouter = require('./routes/shorturl');
const app = express();

app.use(express.json());
app.use('/shorturls', shortUrlRouter);

const db = mongoose.connect('mongodb://localhost:27017/url-shortener', {
  useNewUrlParser: true,
  useUnifiedTopology: true
});
db.on('error', console.error.bind(console, 'connection error:')); // This line is invalid
app.listen(3000, () => console.log('Server running on port 3000'));
